import React from "react";
import gitHubLogo from "../../public/lo"

function Footer(){
    return(
        <div class="footer">
        <a href="https://github.com/Jaymasters440">
            <img src="../../public/logo192.png" height="90px" alt="github logo"></img>
        </a>
        <a href="https://www.linkedin.com/in/jay-masters-95362968/">
            <img src="../../public/1384014.png" height="90px" alt="linkedin"></img>
        </a>
    </div>
    )
}

export default Footer;
